import React from 'react';
import Navvbar1 from "./Navvbar1";

const Resultat = () => {
  return (
    <>
      <Navvbar1 />
      <div style={{ backgroundColor: '#E1EBF6', minHeight: '100vh' }}>
      <div style={{ width: '50%', padding: '20px', backgroundColor: 'white', border: '2px solid #ccc', borderRadius: '10px', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        </div>
      </div>
    </>
  );
};

export default Resultat;
